import React from 'react';
import './App.css';

function App() {
  const [cmd, setCmd] = React.useState("")

  function handleChange(event) {
      setCmd(event.target.value)
  }

  return (
    <form>
      <label>cmd:</label>
      <input 
        type="text"
        placeholder="type sth"
        onChange={handleChange}
        name="cmd"
        value={cmd}
      />
    </form>
  );
}

export default App;
